        <div className="footer-links">
          <a href="#" onClick={(e) => e.preventDefault()}>About</a>
          <a href="#" onClick={(e) => e.preventDefault()}>Privacy Policy</a>
          <a href="#" onClick={(e) => e.preventDefault()}>Contact</a>
        </div>
      </div>
    </footer>
  );
}

export default Footer;
